import React from "react";
import {} from 'react-bootstrap'

function ProductDetails() {
  const obj = {
    Name: "Hari",
    Age: 23,
    Gender: "Male",
    Place: "Kozhikode",
    Dob: "12-12-12",
  };
  return (
    <div style={{ marginLeft: "5rem", marginTop: "5rem" }}>
      <Card style={{ width: "25rem", borderRadius: "5px" }}>
        <Card.Img
          variant="top"
          src="https://www.industrialempathy.com/img/remote/ZiClJf-640w.avif"
          style={{
            width: "10rem",
            height: "8rem",
            marginTop: "1rem",
            marginLeft: "1rem",
            borderRadius: "5px",
          }}
        />
        <Card.Body style={{ flex: 1 }}>
          <Card.Title>{obj.Name}</Card.Title>
          <Card.Text>
            Gender: {obj.Gender}
            <br />
            Age: {obj.Age}
            <br />
            Place : {obj.Place}
            <br />
            Dob : {obj.Dob}
          </Card.Text>
        </Card.Body>
      </Card>
    </div>
  );
}

export default ProductDetails;
